import React from 'react';
import styled from 'styled-components';

const Styles = styled.div`


    display: grid;
    justify-content: center;
    margin-top:5%;


.hey{
	font-size:5vw;
	font-family:'Permanent Marker';
	line-height:1.5em;
	background-color: grey;
  	color: black; 
  	font-weight: bold;
  	width: 100%;
  	text-align: center;
  	position: relative;
  	padding: 0 10px;
  	top:20%;
  	left: 50%;
  	margin-bottom:7%;
  	transform: translate(-50%, -50%);
  	mix-blend-mode: screen;
}
.name{

	font-family:'Gochi Hand';
	font-size:7vw;
	margin-left:2em;

}
.btm{
	font:2vh bold;
	 font:3vh 'Fredoka One';
	 background-color:teal;
	 padding:0 10px;
}
`;

function Home() {
	return(
		<Styles>
		<div className='hey'>HELLO!</div>
		<span>How's it going?</span><br/>
		I am <span className='name'>Bimarsha Khanal.</span><br/>
		<div class='btm'>
		---Computer Engineering | Technophile | Autodidact---
		</div>

		</Styles>

		);
}

export default Home;
